def getuploadfilename():
    infile=filedialog.askopenfilename(filetypes=(('csv files','*.csv'),))
    inpath_text.set(infile)
    global inmzfilename
    inmzfilename=infile

def getoutfilename():
    outfile=filedialog.askopenfilename()
    outpath_text.set(outfile)
    global outfilename
    outfilename=outfile

def getrunmode(event):
    mode=com.get()
    global runmode
    runmode=mode


def run():
    infilename=inmzfilename
    outfile=outfilename
    min = float(entry_min.get())
    max = float(entry_max.get())
    error = float(entry_error.get())

    outybmz = []
    outintensity = []
    outerror = []
    outaccession = []
    outmonisotopic_molecular_weight = []
    outiupac_name = []
    outname = []
    outchemical_formula = []
    outkegg = []
    hmdbdata = pd.read_csv("D:/HMDB45/HMDB/HMDB5_3.csv",usecols=['accession', 'monisotopic_molecular_weight', 'iupac_name', 'name','chemical_formula', 'kegg'])
    inmzdata = pd.read_csv(infilename, usecols=['m/z', 'intensity'])
    inmz = inmzdata['m/z'].values.tolist()
    hmdbmz = hmdbdata['monisotopic_molecular_weight'].values.tolist()

    pro=tk.ttk.Progressbar(windows)
    pro.place(x=270,y=450,width=300,height=16)
    pro['maximum']=len(hmdbmz)
    pro['value']=0
    if runmode=='NO':
        for i in range(len(hmdbmz)) :
            if hmdbmz[i]<min or hmdbmz[i]>max:
                pro['value']=i
                windows.update()
                continue
            else:
                for k in range(len(inmz)):
                    if hmdbmz[i]-error<inmz[k]<hmdbmz[i]+error:
                        wcc=abs(hmdbmz[i]-inmz[k])

                        outybmz.append(inmz[k])
                        outintensity.append(inmzdata.iloc[k,1])
                        outerror.append(wcc)
                        outaccession.append(hmdbdata.iloc[i,0])
                        outmonisotopic_molecular_weight.append(hmdbmz[i])
                        outiupac_name.append(hmdbdata.iloc[i,2])
                        outname.append(hmdbdata.iloc[i,3])
                        outchemical_formula.append(hmdbdata.iloc[i,4])
                        outkegg.append(hmdbdata.iloc[i,5])

        outdf = pd.DataFrame({'inmz': outybmz, 'intensity': outintensity, 'monisotopic_molecular_weight': outmonisotopic_molecular_weight,'error': outerror, 'iupac_name': outiupac_name, 'name': outname, 'accession': outaccession,'chemical_formula': outchemical_formula, 'kegg': outkegg})
        outdf.to_csv(outfile, index=False)

    elif runmode=='YES':
        for i in range(len(hmdbmz)):
            if hmdbmz[i] < min or hmdbmz[i] > max:
                pro['value'] = i
                windows.update()
                continue
            else:
                for k in range(len(inmz)):
                    if hmdbmz[i] - error < inmz[k] + 1.0078 < hmdbmz[i] + error:
                        wcc = abs(hmdbmz[i] - inmz[k] - 1.0078)

                        outybmz.append(inmz[k])
                        outintensity.append(inmzdata.iloc[k, 1])
                        outerror.append(wcc)
                        outaccession.append(hmdbdata.iloc[i, 0])
                        outmonisotopic_molecular_weight.append(hmdbmz[i])
                        outiupac_name.append(hmdbdata.iloc[i, 2])
                        outname.append(hmdbdata.iloc[i, 3])
                        outchemical_formula.append(hmdbdata.iloc[i, 4])
                        outkegg.append(hmdbdata.iloc[i, 5])
        outdf = pd.DataFrame({'inmz': outybmz, 'intensity': outintensity,'monisotopic_molecular_weight': outmonisotopic_molecular_weight, 'error': outerror,'iupac_name': outiupac_name, 'name': outname, 'accession': outaccession,'chemical_formula': outchemical_formula, 'kegg': outkegg})
        outdf.to_csv(outfile, index=False)
    tk.messagebox.showinfo(title='',message='Completed successfully')





